import React, {useEffect, useState } from 'react';
import {BackHandler, Platform, Image, StatusBar, View, Text, SafeAreaView, ScrollView, Dimensions, toast} from '../lib/react-native';
import { hiddenNavigationOptions } from '../lib/navigation';
import Wave from '../lib/svg';
import Item from './Item';
import {Banner} from './Firebase';
import Touch from './Touch';
import AccessControl from './AccessControl';
import AdvertisingBar from './AdvertisingBar';
import {redux} from '../store';
import styles from '../styles';
import {requestMultiplePermission} from '../permissions';

const css = styles('Home');
const { width, height } = Dimensions.get('window');

const Header = ({img})=> {

	const [payer, setPayer] = useState(null);
	const [collector, setCollector] = useState(null);
	const onPress = () => {
		return null;
		redux.push('click_header', true);
		redux.push('navigate', 'HowDoesItWork');
	}

	useEffect(() => {
		setTimeout(()=>{
	      setPayer(redux.get('payer'));
	      setCollector(redux.get('collector'));
	    }, 500);
	    const unsubscribe = redux.subscribe( () => {
	    	if(redux.is('payer')){
		      	setPayer(redux.get('payer'));
		    }
		    else if(redux.is('collector')){
		      	setCollector(redux.get('collector'));
		    }
	    });
	    return () => unsubscribe();
	},[]);

	var identity = (payer && collector && payer.id===collector.id)? true : false;

	return(
		<View style={{backgroundColor:'transparent'}} onPress={onPress}>
			<View style={css.header}>
				<View style={css.logo}>
				<Image  style={css.imageLogo} source={{uri: 'data:image/png;base64,'}}/>
				</View>
				{(!identity && payer)?<Touch style={css.payer} onPress={onPress}>
					<Text style={css.payerText2}>{payer.name}</Text>
					<Text style={css.payerText1}>pagas:</Text>
				</Touch>:null}
				{collector?<Touch style={css.collector} onPress={onPress}>
					<Text style={css[identity?'collectorText3':'collectorText2']}>{collector.name}</Text>
					{!identity?<Text style={css.collectorText1}>recibes:</Text>:null}
				</Touch>:null}
				{/**/}
				<View style={css.name}>
					<Text style={css.nameText}>BankQr</Text>
				</View>
				{/*(payer || collector)?<AdvertisingBar onPress={onPress} />:null*/}
			</View>
			<Image style={css.imageOnda} source={{uri: img}} />
		</View>
	);
}
//			<Wave width={width} height={height}/>

const Footer = () =>
  <View style={css.footer}>
    <Banner />
  </View>;

const Version = () =>
  <View style={css.viewVersion}>
    <View style={css.viewFin} />
    <Text style={css.textVersion}>Versin 1.0.{parseInt(Platform.Version, 10)}</Text>
  </View>

var img = 'data:image/png;base64,'

const Home = ({navigation, load}) => {

	const [access, setAccess] = useState(false);
	const [component, setComponent] = useState(null);
	const [security, setSecurity] = useState({});

	const onChange = value => {
		if(value){
			setAccess(false);
			redux.push('navigate', component);
		}
		else{
			toast('PIN invalido');
		}
	}
	const onPress = async component => {

		if(['ReadCodeQr','Calculator','RemotePayments'].includes(component)){
			await requestMultiplePermission()
		}

		if(['RemotePayments','ReadCodeQr'].includes(component)){
		    if(!redux.get('payer')){
		      toast('Configure un Emisor de Pagos');
		      return null;
		    }
		}
		/*
		let permission = security.menu[component]??null;

		if(permission===true && permission!==null){
			setComponent(component);
			setAccess(true);
			return null;
		}
		*/
		redux.push('navigate', component);
	}

	useEffect(() => {
	    if(load){
	    	let security = redux.get('security');
	    	setSecurity(security);
	    	setAccess(security.active);
	    }
	},[load]);

	useEffect(() => {
	    const unsubscribe = redux.subscribe( () => {
	    	if(redux.is('security')){
		      	setSecurity(redux.get('security'));
		    }
		    else if(redux.is('access')){
		      	setSecurity(redux.get('access'));
		    }
	    });
	    return () => unsubscribe();
	},[]);
  	
  	return(
    <View style={css.content}>
		{!load?
			<View style={css.load}>
			<View style={css.logoLoad}>
			<Image  style={css.imageLogoLoad} source={{uri: 'data:image/png;base64,'}}/>
			</View>
			<Text style={css.nameTextLoadFrom}>from</Text>
			<Text style={css.nameTextLoadFromMail}>SITGEM</Text>
			<Image source={{uri: img}} />
		</View>
		:null}
     <StatusBar barStyle="light-content" androidStatusBarColor="#34495e" backgroundColor={"rgba(255,165,0, 1)"}
	    hidden={false} animated={true} translucent={false}
	  />
      <Header img={img}/>
      <SafeAreaView style={css.safeAreaView}>
        <ScrollView style={css.scrollView}>
          <View style={css.space} />
          <Item icon="qr-code-scanner" title="Pagar con Qr" onPress={()=>onPress('ReadCodeQr')}  />
          <Item icon="qr-code-2" title="Recibir Pago con Qr" onPress={()=>onPress('Calculator')}  />
          <Item icon="send-to-mobile" title="Pago Remoto" onPress={()=>onPress('RemotePayments')}  />
          <Item icon="view-in-ar" title="Historial de transacciones" onPress={()=>onPress('Story')}  />
          <Item icon="contacts" title="Mis Cuentas Bancarias" onPress={()=>onPress('Accounts')}  />
          <Item icon="menu-book" title="Cmo funciona?" onPress={()=>onPress('HowDoesItWork')}  />
          <Item icon="help-outline" title="Ayuda" onPress={()=>onPress('Help')}  />
          <Item icon="security" title="Seguridad" onPress={()=>onPress('Security')}  />
          {/*
          	<Item icon="slow-motion-video" title="Recompensa Publicitaria" onPress={()=>redux.push('addAdmobRewarded', true)}  />
      		*/}
          <Version />
        </ScrollView>
      </SafeAreaView>
      <Footer />
      {access?<AccessControl onCancel={()=>BackHandler.exitApp()} onChange={onChange}/>:null}
    </View>);
}

export default {
  screen: Home,
  path: 'Home/:name',
  navigationOptions: p => hiddenNavigationOptions,
}